import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import React from 'react';
import './main.css';

function main() {
    
    return (
        		<div class="your-topics">
				<form id="search-form">
					<input
						type="search"
						class="searchbar"
						placeholder=" Your Topics..."
						name="search"
						id="search-input" />
				</form>
			</div>

    );
}
export default main;
